/* Subtract two Montgomery form numbers (r = a - b % m).
 *
 * r   Result of subtration.
 * a   Number to subtract from in Montogmery form.
 * b   Number to subtract with in Montogmery form.
 * m   Modulus (prime).
 */
static void sp_256_mont_sub_dbl_4(sp_digit* r, const sp_digit* a, const sp_digit* b,
        const sp_digit* m)
{
    __asm__ __volatile__ (
        "ldp	x8, x9, [%[b]]\n\t"
        "ldp	x10, x11, [%[b],16]\n\t"
        "adds	x8, x8, x8\n\t"
        "ldp	x4, x5, [%[a]]\n\t"
        "adcs	x9, x9, x9\n\t"
        "ldp	x6, x7, [%[a],16]\n\t"
        "adcs	x10, x10, x10\n\t"
        "adcs	x11, x11, x11\n\t"
        "mov	x13, 0xffffffff00000001\n\t"
        "csetm	x14, cs\n\t"
        "subs	x8, x8, x14\n\t"
        "lsr	x12, x14, 32\n\t"
        "sbcs	x9, x9, x12\n\t"
        "and	x13, x13, x14\n\t"
        "sbcs	x10, x10, xzr\n\t"
        "sbc	x11, x11, x13\n\t"
        "subs	x4, x4, x8\n\t"
        "sbcs	x5, x5, x9\n\t"
        "sbcs	x6, x6, x10\n\t"
        "sbcs	x7, x7, x11\n\t"
        "mov	x13, 0xffffffff00000001\n\t"
        "csetm	x14, cc\n\t"
        "adds	x4, x4, x14\n\t"
        "lsr	x12, x14, 32\n\t"
        "adcs	x5, x5, x12\n\t"
        "and	x13, x13, x14\n\t"
        "adcs	x6, x6, xzr\n\t"
        "stp	x4, x5, [%[r],0]\n\t"
        "adc	x7, x7, x13\n\t"
        "stp	x6, x7, [%[r],16]\n\t"
        :
        : [r] "r" (r), [a] "r" (a), [b] "r" (b), [m] "r" (m)
        : "memory", "x4", "x5", "x6", "x7", "x8", "x9", "x10", "x11", "x12", "x13", "x14"
    );
}

